import React from "react";
import "./Resume.css";

function Resume() {
  return (
    <div className="all">
      <video src="/videos/video-1.mp4" autoPlay loop muted />
      <h1 className="header">
        <span>Hey,</span> I'm
        <br />
        Priel
      </h1>
      <img
        className="ResumePhoto"
        src="images/PrielHazanResume.jpg"
        alt="Priel Hazan Resume"
      />
    </div>
  );
}

export default Resume;
